import React, { useState } from "react";
import {
  AppBar,
  Box,
  Drawer,
  IconButton,
  Toolbar,
  Typography,
  useMediaQuery,
  Autocomplete,
  TextField,
} from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import { styled, useTheme } from "@mui/system";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import SearchIcon from "@mui/icons-material/Search";
import FavoriteBorderIcon from "@mui/icons-material/FavoriteBorder";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import axios from "axios";
import TopHeader from "../../src/Global/TopHeader";

const StyledAppBar = styled(AppBar)(({ theme, backgroundColor }) => ({
  backgroundColor: backgroundColor || theme.palette.background.paper,
  boxShadow: "0 4px 12px rgba(0, 0, 0, 0.1)",
}));

const Header = () => {
  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down("md"));
  const navigate = useNavigate();
  const [drawerState, setDrawerState] = useState({ menu: false });
  const [searchQuery, setSearchQuery] = useState("");
  const [searchResults, setSearchResults] = useState([]);

  const menuItems = [
    { label: "Home", to: "/" },
    { label: "Collection", to: "/collection" },
    { label: "Contact Us", to: "/contact" },
  ];

  const toggleDrawer = (drawerName, open) => () => {
    setDrawerState((prevState) => ({ ...prevState, [drawerName]: open }));
  };

  const handleSearch = async (query) => {
    setSearchQuery(query);
    if (query) {
      try {
        const response = await axios.get(`http://localhost:9000/api/products/search?query=${query}`);
        setSearchResults(response.data.success ? response.data.products : []);
      } catch (error) {
        setSearchResults([]);
      }
    } else {
      setSearchResults([]);
    }
  };

  return (
    <>
      <TopHeader />
      <StyledAppBar position="relative">
        <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
          {/* Logo and Menu Icon */}
          <Box sx={{ display: "flex", alignItems: "center" }}>
            {isSmallScreen && (
              <IconButton onClick={toggleDrawer("menu", true)}>
                <MenuIcon />
              </IconButton>
            )}
            <Link to="/">
              <Box sx={{ width: "100px" }}>
                <img src="https://i.postimg.cc/gcBKX5Zy/png-clipart-the-jewellery-channel-gemological-institute-of-america-jewelry-television-sapphire-jewel.png" alt="logo" />
              </Box>
            </Link>
          </Box>

          {/* Search Bar */}
          <Box sx={{ width: isSmallScreen ? "100%" : "30%" }}>
            <Autocomplete
              freeSolo
              options={searchResults}
              getOptionLabel={(option) => option.name || ""}
              onInputChange={(event, newValue) => handleSearch(newValue)}
              renderInput={(params) => (
                <TextField
                  {...params}
                  placeholder="Search products..."
                  variant="outlined"
                  size="small"
                  InputProps={{
                    ...params.InputProps,
                    startAdornment: <SearchIcon sx={{ marginLeft: 1, marginRight: 1 }} />,
                  }}
                />
              )}
            />
          </Box>

          {/* Icons */}
          <Box sx={{ display: "flex", alignItems: "center", gap: 2 }}>
            <IconButton component={Link} to="/wishlist">
              <FavoriteBorderIcon />
            </IconButton>
            <IconButton component={Link} to="/cart">
              <ShoppingCartIcon />
            </IconButton>
            <IconButton component={Link} to="/profile">
              <AccountCircleIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </StyledAppBar>

      {/* Drawer for Small Screens */}
      <Drawer anchor="left" open={drawerState.menu} onClose={toggleDrawer("menu", false)}>
        <Box sx={{ padding: 2, width: "300px", position: "relative" }}>
          <IconButton onClick={toggleDrawer("menu", false)} sx={{ position: "absolute", top: "8px", right: "8px" }}>
            <CloseIcon />
          </IconButton>
          {menuItems.map((item, index) => (
            <Link key={index} to={item.to} onClick={toggleDrawer("menu", false)}>
              <Typography sx={{ py: 2, color: theme.palette.black.main, "&:hover": { color: theme.palette.secondary.main }}}>
                {item.label}
              </Typography>
            </Link>
          ))}
        </Box>
      </Drawer>
    </>
  );
};

export default Header;
